// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract RockPaperScissors {
    enum Move { Rock, Paper, Scissors }
    enum BetTier { TIER_1, TIER_2, TIER_3, TIER_4, TIER_5 }
    enum GameState { None, Played }

    struct PendingReward {
        uint256 amount;
        bool claimed;
    }

    struct PlayerStats {
        uint256 lastPlayTime;
        uint256 totalWins;
    }

    struct GameProof {
        uint256 blockNumber;       // Bloc utilisé pour la génération aléatoire
        uint256 timestamp;         // Timestamp de la transaction
        bytes32 blockHash;         // Hash du bloc utilisé
        bytes32 randomnessProof;   // Preuve utilisée pour générer le coup du contrat
        Move contractMove;         // Coup généré par le contrat
        Move playerMove;           // Coup du joueur
        address player;            // Adresse du joueur
    }

    address public owner;
    uint256 public creatorFees;
    uint256 public gameBank;
    bool public isPaused = false;
    uint256 public constant COOLDOWN = 15; // secondes entre deux parties

    // Variables pour le mécanisme de mise à jour
    address public implementation;
    bool public upgradeEnabled = false;

    // Constantes de sécurité financière
    uint256 public constant MAX_BET_AMOUNT = 0.5 ether; // Mise maximale
    uint256 public constant MAX_WITHDRAWAL_AMOUNT = 5 ether; // Montant maximal de retrait
    uint256 public constant MAX_CONTRACT_BALANCE = 100 ether; // Solde maximal du contrat

    // Variable pour protéger contre la réentrance
    bool private _locked;

    mapping(BetTier => uint256) public tierToAmount;
    mapping(address => PlayerStats) public playerStats;
    mapping(address => PendingReward[]) public pendingRewards;
    mapping(bytes32 => GameProof) public gameProofs;

    event GamePlayed(address indexed player, Move playerMove, Move contractMove, string result, uint256 netWin, bytes32 proofHash);
    event RewardClaimed(address indexed player, uint256 index, uint256 amount);
    event CreatorFeesWithdrawn(uint256 amount);
    event Paused(bool status);
    event EmergencyWithdrawal(address indexed receiver, uint256 amount);
    event ImplementationUpdated(address indexed oldImpl, address indexed newImpl);
    event UpgradeStatusChanged(bool enabled);
    event GameBankSynced(uint256 newAmount);

    modifier onlyOwner() {
        require(msg.sender == owner, "Not owner");
        _;
    }

    modifier notPaused() {
        require(!isPaused, "Game is paused");
        _;
    }

    // Protection contre la réentrance
    modifier nonReentrant() {
        require(!_locked, "ReentrancyGuard: reentrant call");
        _locked = true;
        _;
        _locked = false;
    }

    // Vérifie que le montant de mise est acceptable
    modifier validBetAmount(uint256 amount) {
        require(amount <= MAX_BET_AMOUNT, "Bet exceeds maximum allowed");
        _;
    }

    constructor() {
        owner = msg.sender;
        implementation = address(this); // Au départ, l'implémentation est ce contrat lui-même
        tierToAmount[BetTier.TIER_1] = 0.005 ether;
        tierToAmount[BetTier.TIER_2] = 0.01 ether;
        tierToAmount[BetTier.TIER_3] = 0.025 ether;
        tierToAmount[BetTier.TIER_4] = 0.05 ether;
        tierToAmount[BetTier.TIER_5] = 0.1 ether;
    }

    // Activer ou désactiver la possibilité de mise à jour
    function setUpgradeEnabled(bool enabled) external onlyOwner {
        upgradeEnabled = enabled;
        emit UpgradeStatusChanged(enabled);
    }

    // Mettre à jour l'adresse de l'implémentation
    function updateImplementation(address newImplementation) external onlyOwner {
        require(upgradeEnabled, "Upgrades are not enabled");
        require(newImplementation != address(0), "Invalid implementation address");
        require(newImplementation != implementation, "Same implementation");

        address oldImplementation = implementation;
        implementation = newImplementation;

        emit ImplementationUpdated(oldImplementation, newImplementation);
    }

    // Déléguer l'appel à l'implémentation si ce n'est pas une fonction de base
    fallback() external payable {
        // Si nous avons une implémentation différente et que les mises à jour sont activées
        if (implementation != address(this) && upgradeEnabled) {
            assembly {
                // Copier le calldata de l'appel
                calldatacopy(0, 0, calldatasize())

                // Déléguer l'appel à l'implémentation
                let result := delegatecall(gas(), sload(implementation.slot), 0, calldatasize(), 0, 0)

                // Copier la valeur de retour pour la renvoyer
                returndatacopy(0, 0, returndatasize())

                // Retourner le résultat ou reverter avec le message d'erreur
                switch result
                case 0 { revert(0, returndatasize()) }
                default { return(0, returndatasize()) }
            }
        } else {
            // Si pas de délégation, ajouter les fonds à la banque de jeu
            gameBank += msg.value;
        }
    }

    // Recevoir des ETH
    receive() external payable {
        gameBank += msg.value;
    }

    // Fonction qui combine commit et reveal en une seule transaction
    function playGame(Move playerMove, BetTier tier) external payable notPaused validBetAmount(tierToAmount[tier]) {
        require(block.timestamp >= playerStats[msg.sender].lastPlayTime + COOLDOWN, "Wait before playing again");
        uint256 betAmount = tierToAmount[tier];
        require(msg.value == betAmount, "Incorrect ETH amount sent");

        // Version simplifiée pour Monad - réduction des vérifications
        // require(address(this).balance >= (betAmount * 192) / 100, "Not enough balance to pay win");
        // require(address(this).balance <= MAX_CONTRACT_BALANCE, "Contract balance limit reached");

        // Générer le coup du contrat avec une preuve vérifiable - version ultra-optimisée pour gaz
        bytes32 blockHash = blockhash(block.number - 1);
        uint256 random = uint256(keccak256(abi.encodePacked(
            blockHash,
            block.timestamp,
            msg.sender,
            playerMove
        )));

        // Générer le coup du contrat
        Move contractMove = Move(random % 3);

        // Hash unique pour cette partie (simplifié)
        bytes32 proofHash = keccak256(abi.encodePacked(
            random,
            contractMove,
            playerMove,
            msg.sender
        ));

        // Stocker la preuve pour cette partie (forme simplifiée)
        gameProofs[proofHash] = GameProof({
            blockNumber: block.number - 1,
            timestamp: block.timestamp,
            blockHash: blockHash,
            randomnessProof: bytes32(random),
            contractMove: contractMove,
            playerMove: playerMove,
            player: msg.sender
        });

        // Déterminer le résultat
        string memory result;
        uint256 netGain = 0;

        if (_didPlayerWin(playerMove, contractMove)) {
            // Win: 192% (gain = 92%)
            uint256 payout = betAmount + (betAmount * 92) / 100;
            netGain = (betAmount * 92) / 100;

            pendingRewards[msg.sender].push(PendingReward(payout, false));
            creatorFees += (betAmount * 3) / 100;
            gameBank += (betAmount * 7) / 100;
            playerStats[msg.sender].totalWins += 1;

            result = "Win";
        } else if (playerMove == contractMove) {
            // Draw: refund 98%, 2% creator
            uint256 refund = (betAmount * 98) / 100;
            pendingRewards[msg.sender].push(PendingReward(refund, false));
            creatorFees += (betAmount * 2) / 100;

            result = "Draw";
        } else {
            // Lose: 3% creator, 97% game bank
            creatorFees += (betAmount * 3) / 100;
            gameBank += (betAmount * 97) / 100;

            result = "Lose";
        }

        // Mettre à jour le timestamp de la dernière partie
        playerStats[msg.sender].lastPlayTime = block.timestamp;

        emit GamePlayed(msg.sender, playerMove, contractMove, result, netGain, proofHash);
    }

    // Vérifier la validité d'une preuve de jeu
    function verifyGameProof(bytes32 proofHash) external view returns (bool isValid, string memory details) {
        GameProof memory proof = gameProofs[proofHash];

        // Vérifier que la preuve existe
        if (proof.timestamp == 0) {
            return (false, "Proof not found");
        }

        // Vérifier que le blockHash correspond au blockNumber si encore accessible
        if (proof.blockNumber + 256 >= block.number && blockhash(proof.blockNumber) != proof.blockHash) {
            return (false, "Block hash mismatch");
        }

        // Si le bloc est trop ancien pour vérifier le hash
        if (proof.blockNumber + 256 < block.number) {
            return (true, "Block too old to fully verify, but proof exists");
        }

        // Recalculer la preuve d'aléatoire
        bytes32 recalculatedProof = keccak256(abi.encodePacked(
            proof.blockHash,
            block.prevrandao,  // Note: cette valeur peut avoir changé, ce qui est une limitation
            proof.timestamp,
            proof.player,
            address(this).balance,  // Le solde actuel peut être différent
            proof.playerMove
        ));

        // Vérifier que le coup généré correspond
        uint256 random = uint256(recalculatedProof);
        Move recalculatedMove = Move(random % 3);

        if (recalculatedMove != proof.contractMove) {
            return (false, "Move generation mismatch");
        }

        return (true, "Proof verification successful");
    }

    // Obtenir les détails d'un jeu à partir de son hash de preuve
    function getGameDetails(bytes32 proofHash) external view returns (
        uint256 blockNumber,
        uint256 timestamp,
        address player,
        Move playerMove,
        Move contractMove,
        bool playerWon
    ) {
        GameProof memory proof = gameProofs[proofHash];
        require(proof.timestamp > 0, "Game proof not found");

        return (
            proof.blockNumber,
            proof.timestamp,
            proof.player,
            proof.playerMove,
            proof.contractMove,
            _didPlayerWin(proof.playerMove, proof.contractMove)
        );
    }

    // Vérifier si le joueur a gagné
    function _didPlayerWin(Move player, Move ai) internal pure returns (bool) {
        return (player == Move.Rock && ai == Move.Scissors) ||
               (player == Move.Paper && ai == Move.Rock) ||
               (player == Move.Scissors && ai == Move.Paper);
    }

    // Récupérer une récompense spécifique
    function claimReward(uint256 index) external nonReentrant {
        require(index < pendingRewards[msg.sender].length, "Invalid index");
        PendingReward storage reward = pendingRewards[msg.sender][index];
        require(!reward.claimed, "Already claimed");
        require(address(this).balance >= reward.amount, "Insufficient balance");
        require(reward.amount <= MAX_WITHDRAWAL_AMOUNT, "Amount exceeds maximum withdrawal");

        // Marquer comme réclamé avant le transfert (Pattern check-effects-interactions)
        reward.claimed = true;
        uint256 amountToSend = reward.amount;

        // Effectuer le transfert après avoir modifié l'état
        (bool success, ) = payable(msg.sender).call{value: amountToSend}("");
        require(success, "Claim failed");

        emit RewardClaimed(msg.sender, index, amountToSend);
    }

    // Récupérer toutes les récompenses
    function claimAllRewards() external nonReentrant {
        PendingReward[] storage rewards = pendingRewards[msg.sender];
        uint256 totalToClaim = 0;

        // Marquer toutes les récompenses comme réclamées d'abord
        for (uint256 i = 0; i < rewards.length; i++) {
            if (!rewards[i].claimed) {
                totalToClaim += rewards[i].amount;
                rewards[i].claimed = true;
            }
        }

        require(totalToClaim > 0, "No unclaimed rewards");
        require(address(this).balance >= totalToClaim, "Insufficient balance");
        require(totalToClaim <= MAX_WITHDRAWAL_AMOUNT, "Amount exceeds maximum withdrawal");

        // Transférer les fonds après avoir modifié l'état
        (bool success, ) = payable(msg.sender).call{value: totalToClaim}("");
        require(success, "Claim failed");

        emit RewardClaimed(msg.sender, type(uint256).max, totalToClaim);
    }

    // Obtenir le nombre de récompenses en attente
    function getPendingRewardCount(address player) external view returns (uint256) {
        return pendingRewards[player].length;
    }

    // Récupérer le dernier timestamp de jeu d'un joueur
    function lastPlayTimestamp(address player) external view returns (uint256) {
        return playerStats[player].lastPlayTime;
    }

    // Récupérer le nombre total de victoires d'un joueur
    function playerTotalWins(address player) external view returns (uint256) {
        return playerStats[player].totalWins;
    }

    // Retirer les frais du créateur
    function withdrawCreatorFees() external onlyOwner nonReentrant {
        require(creatorFees > 0, "No fees to withdraw");
        uint256 amount = creatorFees;
        require(amount <= MAX_WITHDRAWAL_AMOUNT, "Amount exceeds maximum withdrawal");

        // Mettre à jour l'état avant le transfert
        creatorFees = 0;

        (bool success, ) = payable(owner).call{value: amount}("");
        require(success, "Withdraw failed");

        emit CreatorFeesWithdrawn(amount);
    }

    // Mettre en pause ou reprendre le jeu
    function setPaused(bool _paused) external onlyOwner {
        isPaused = _paused;
        emit Paused(_paused);
    }

    // Mettre à jour les montants de mise (avec vérification de sécurité)
    function updateTierAmount(BetTier tier, uint256 amount) external onlyOwner {
        require(amount <= MAX_BET_AMOUNT, "Amount exceeds maximum allowed bet");
        tierToAmount[tier] = amount;
    }

    // Synchroniser la banque du jeu avec le solde réel du contrat
    function syncGameBank() external onlyOwner {
        uint256 totalBalance = address(this).balance;
        // Conserver les frais du créateur inchangés
        uint256 newGameBank = totalBalance - creatorFees;
        gameBank = newGameBank;
        emit GameBankSynced(gameBank);
    }

    // Obtenir le montant accumulé dans la banque du jeu
    function getGameBank() external view returns (uint256) {
        return gameBank;
    }

    // Obtenir le solde total du contrat
    function getContractBalance() external view returns (uint256) {
        return address(this).balance;
    }

    // Fonction de compatibilité (obsolète)
    function commitMove(bytes32 moveHash, BetTier tier) external payable notPaused {
        revert("This function is deprecated. Use playGame instead.");
    }

    // Fonction de compatibilité (obsolète)
    function revealMove(Move playerMove, bytes32 salt) external notPaused {
        revert("This function is deprecated. Use playGame instead.");
    }

    // Fonction de compatibilité (obsolète)
    function play(BetTier tier, Move playerMove) external payable notPaused {
        revert("This function is deprecated. Use playGame instead.");
    }

    // Fonction explicite pour ajouter des fonds au contrat
    function addFunds() external payable {
        gameBank += msg.value;
    }

    // Fonction d'urgence pour retirer tous les fonds du contrat - UNIQUEMENT en cas d'urgence
    function emergencyWithdraw() external onlyOwner nonReentrant {
        // Vérifier que le jeu est en pause - mesure de sécurité
        require(isPaused, "Game must be paused before emergency withdrawal");

        // Calculer le montant total à retirer
        uint256 totalAmount = address(this).balance;
        require(totalAmount > 0, "No funds to withdraw");

        // Réinitialiser les soldes
        gameBank = 0;
        creatorFees = 0;

        // Transférer tout le solde au propriétaire
        (bool success, ) = payable(owner).call{value: totalAmount}("");
        require(success, "Emergency withdrawal failed");

        // Émettre un événement pour la transparence
        emit EmergencyWithdrawal(owner, totalAmount);
    }
}

